
let image = new Image();
image.src = 'data:image/jpeg;base64,';
document.querySelector('body').append(image);
console.info(image)
// ctx.drawImage(image, 0, 0);



//650 x366

const canvas = document.querySelector('.canvas');
let ctx = canvas.getContext('2d');

  function editPixels(imageData) {
    console.info(imageData);

    imageData.forEach((data, i)=>{
    // i < 100 ? console.info(i+= 4) : null;
      data[i] = data[i]; // Red
      data[i+1] = 0; // Green
      data[i+2] = 0; // Blue
    });
  }

  function drawEditedImage(newData) {
    ctx.putImageData(newData, 0, 0);
  }

  image.onload = () => {
    console.log(image.width);

    ctx.drawImage(image, 0, 0, image.width, image.height, 0, 0, image.width, image.height);
    
      let imageData = ctx.getImageData(0, 0, image.width, image.height);
      // console.log(imageData.data);

      editPixels(imageData.data);

      drawEditedImage(imageData);
};



